import React from "react";
import styled from "styled-components";
import {Swiper, SwiperSlide} from "swiper/react";
import "swiper/css";
import "swiper/css/effect-cards";
import { EffectCards } from "swiper";

import img1 from "../images/NFTs/bighead.svg";
import img2 from "../images/NFTs/bighead-1.svg";
import img3 from "../images/NFTs/bighead-2.svg";
import img4 from "../images/NFTs/bighead-3.svg";
import img5 from "../images/NFTs/bighead-4.svg";
import img6 from "../images/NFTs/bighead-5.svg";
import img7 from "../images/NFTs/bighead-6.svg";
import img8 from "../images/NFTs/bighead-7.svg";
import img9 from "../images/NFTs/bighead-8.svg";
import img10 from "../images/NFTs/bighead-9.svg";

const Container = styled.div`
    width: 25vw;
    height: 70vh;

.swiper {
    width: 100%;
    height: 100%;
}
`;

const Carousel = () => {
    return (
        <Container>
            <Swiper
            effect={"cards"}
            grabCursor={true}
            modules={[EffectCards]}
            className="mySwiper"
            >
                <SwiperSlide>Slide 1</SwiperSlide>
                <SwiperSlide>Slide 2</SwiperSlide>
                <SwiperSlide>Slide 3</SwiperSlide>
                <SwiperSlide>Slide 4</SwiperSlide>
                <SwiperSlide>Slide 5</SwiperSlide>
                <SwiperSlide>Slide 6</SwiperSlide>
                <SwiperSlide>Slide 7</SwiperSlide>
                <SwiperSlide>Slide 8</SwiperSlide>
                <SwiperSlide>Slide 9</SwiperSlide>
            </Swiper>
        </Container>
    );
}

export default Carousel;
